```java
import org.apache.spark.api.java.JavaPairRDD;
import org.apache.spark.api.java.JavaRDD;
import org.apache.spark.api.java.function.Function;
import org.apache.spark.api.java.function.PairFunction;
import scala.Tuple2;

import java.sql.Timestamp;
import java.util.HashMap;
import java.util.Map;

public class HitRateCalculator {

    public static void main(String[] args) {
        // Create a SparkSession
        org.apache.spark.SparkConf conf = new org.apache.spark.SparkConf().setAppName("HitRateCalculator");
        org.apache.spark.api.java.JavaSparkContext sc = new org.apache.spark.api.java.JavaSparkContext(conf);
        org.apache.spark.api.java.JavaSparkSession spark = org.apache.spark.api.java.JavaSparkSession.builder().appName("HitRateCalculator").config(sc.getConf()).getOrCreate();

        // Load onsite attributed data
        JavaRDD<String> onsiteAttributedData = spark.read().textFile("onsite_attributed_data.csv").javaRDD();
        JavaRDD<Tuple2<String, Timestamp>> onsiteAttributedDataRDD = onsiteAttributedData.map(new Function<String, Tuple2<String, Timestamp>>() {
            @Override
            public Tuple2<String, Timestamp> call(String line) throws Exception {
                String[] fields = line.split(",");
                return new Tuple2<>(fields[0], new Timestamp(Long.parseLong(fields[1]) * 1000));
            }
        });

        // Load top frequent queries
        JavaRDD<String> topFrequentQueries = spark.read().textFile("top_frequent_queries.csv").javaRDD();

        // Create a map to store the queries and their last access time
        Map<String, Timestamp> queryCache = new HashMap<>();

        // Create a pair RDD to store the query and its hit status
        JavaPairRDD<String, Boolean> hitStatusRDD = onsiteAttributedDataRDD.mapToPair(new PairFunction<Tuple2<String, Timestamp>, String, Boolean>() {
            @Override
            public Tuple2<String, Boolean> call(Tuple2<String, Timestamp> tuple) throws Exception {
                String query = tuple._1;
                Timestamp currentTime = tuple._2;
                if (topFrequentQueries.contains(query)) {
                    if (!queryCache.containsKey(query) || queryCache.get(query).before(currentTime.minus(12 * 60 * 60 * 1000))) {
                        queryCache.put(query, currentTime);
                        return new Tuple2<>(query, false);
                    } else {
                        return new Tuple2<>(query, true);
                    }
                } else {
                    return new Tuple2<>(query, false);
                }
            }
        });

        // Calculate the hit rate
        double hitRate = (double) hitStatusRDD.filter(t -> t._2).count() / hitStatusRDD.count();
        System.out.println("Hit Rate: " + hitRate);

        // Stop the SparkSession
        spark.stop();
    }
}
```

